import React from "react";
function Addproduct() {
  return (
    <div>
      <h3>Add Product</h3>
      <form>
        <label>Choose Category:</label>
        <select>
          <option value="xyz">xyz</option>
        </select>

        <p>Product Title</p>
        <input type="text" />
      </form>
    </div>
  );
}

export default Addproduct;
